export  const userEmail = (data)=>{
    return{
        type:"User_Email",
        payload:data
    }
}
export  const user= (data)=>{
    return{
        type:"User_Type",
        payload:data
    }
}

export const flag=(value)=>{
    console.log(value);
    return{
        type:"Toggle",
        payload:value
    }
}

//Admin Dashboard

export const loadAdminDetails = () => async (dispatch) => {
    try {
      dispatch({ type: "Admin_Details_Request" });
      const { data } = await axios.get(`/api/v1/admin/users`);
  
      dispatch({ type: "Admin_Details_Success", payload: data.users });
    } catch (error) {
      dispatch({ type: "Admin_Details_Success", payload: error.response.data.message });
    }
  };
